INSERT INTO `cms_article` VALUES (15,'系统简介',1,'2022-08-06 14:14:58',1,'2022-08-13 10:43:13',1,'<div class=\"markdown-toc\">\n<h2>目录</h2>\n<ul>\n<li><a href=\"#h2-u6B62u6208u7B80u4ECB\">系统简介</a>\n<ul>\n<li><a href=\"#mcetoc_1g9sf5dji3a\">若依简介</a></li>\n<li><a href=\"#主要特性\">止戈简介</a></li>\n</ul>\n</li>\n<li><a href=\"#mcetoc_1g9seq6p03\">系统需求</a></li>\n<li><a href=\"#mcetoc_1g9rh8evmc\">项目地址</a></li>\n<li><a href=\"#mcetoc_1g9rh8evmc\">注意事项</a></li>\n</ul>\n</div>\n<h2 id=\"h2-u6B62u6208u7B80u4ECB\">系统简介</h2>\n<h3 id=\"mcetoc_1g9sf5dji3a\">若依简介</h3>\n<p>RuoYi 是一个 Java EE 企业级快速开发平台，基于经典技术组合（Spring Boot、Apache Shiro、MyBatis、Thymeleaf、Bootstrap），内置模块如：部门管理、角色用户、菜单及按钮授权、数据权限、系统参数、日志管理、通知公告等。在线定时任务配置；支持集群，支持多数据源，支持分布式事务。</p>\n<ul>\n<li>RuoYi 官网地址：<a href=\"http://ruoyi.vip/\" target=\"_blank\" rel=\"noopener\">http://ruoyi.vip</a></li>\n<li>RuoYi 在线文档：<a href=\"http://doc.ruoyi.vip/\" target=\"_blank\" rel=\"noopener noreferrer\">http://doc.ruoyi.vip</a></li>\n<li>RuoYi 源码下载：<a href=\"https://gitee.com/y_project/RuoYi\" target=\"_blank\" rel=\"noopener noreferrer\">https://gitee.com/y_project/RuoYi</a></li>\n<li>RuoYi 在线提问：<a href=\"https://gitee.com/y_project/RuoYi/issues\" target=\"_blank\" rel=\"noopener noreferrer\">https://gitee.com/y_project/RuoYi/issues</a></li>\n<li>RuoYi 博客：<a href=\"https://www.oschina.net/p/ruoyi\" target=\"_blank\" rel=\"noopener noreferrer\">https://www.oschina.net/p/ruoyi</a></li>\n</ul>\n<h4 id=\"主要特性\">主要特性</h4>\n<ul>\n<li>完全响应式布局（支持电脑、平板、手机等所有主流设备）</li>\n<li>强大的一键生成功能（包括控制器、模型、视图、菜单等）</li>\n<li>支持多数据源，简单配置即可实现切换。</li>\n<li>支持按钮及数据权限，可自定义部门数据权限。</li>\n<li>对常用js插件进行二次封装，使js代码变得简洁，更加易维护</li>\n<li>完善的XSS防范及脚本过滤，彻底杜绝XSS攻击</li>\n<li>Maven多项目依赖，模块及插件分项目，尽量松耦合，方便模块升级、增减模块。</li>\n<li>国际化支持，服务端及客户端支持</li>\n<li>完善的日志记录体系简单注解即可实现</li>\n<li>支持服务监控，数据监控，缓存监控功能。</li>\n</ul>\n<h4 id=\"技术选型\">技术选型</h4>\n<p>1、系统环境</p>\n<ul>\n<li>Java EE 8</li>\n<li>Servlet 3.0</li>\n<li>Apache Maven 3</li>\n</ul>\n<p>2、主框架</p>\n<ul>\n<li>Spring Boot 2.2.x</li>\n<li>Spring Framework 5.2.x</li>\n<li>Apache Shiro 1.7</li>\n</ul>\n<p>3、持久层</p>\n<ul>\n<li>Apache MyBatis 3.5.x</li>\n<li>Hibernate Validation 6.0.x</li>\n<li>Alibaba Druid 1.2.x</li>\n</ul>\n<p>4、视图层</p>\n<ul>\n<li>Bootstrap 3.3.7</li>\n<li>Thymeleaf 3.0.x</li>\n</ul>\n<h4 id=\"内置功能\">内置功能</h4>\n<ul>\n<li>用户管理：用户是系统操作者，该功能主要完成系统用户配置。</li>\n<li>部门管理：配置系统组织机构（公司、部门、小组），树结构展现支持数据权限。</li>\n<li>岗位管理：配置系统用户所属担任职务。</li>\n<li>菜单管理：配置系统菜单，操作权限，按钮权限标识等。</li>\n<li>角色管理：角色菜单权限分配、设置角色按机构进行数据范围权限划分。</li>\n<li>字典管理：对系统中经常使用的一些较为固定的数据进行维护。</li>\n<li>参数管理：对系统动态配置常用参数。</li>\n<li>通知公告：系统通知公告信息发布维护。</li>\n<li>操作日志：系统正常操作日志记录和查询；系统异常信息日志记录和查询。</li>\n<li>登录日志：系统登录日志记录查询包含登录异常。</li>\n<li>在线用户：当前系统中活跃用户状态监控。</li>\n<li>定时任务：在线（添加、修改、删除)任务调度包含执行结果日志。</li>\n<li>代码生成：前后端代码的生成（java、html、xml、sql)支持CRUD下载 。</li>\n<li>系统接口：根据业务代码自动生成相关的api接口文档。</li>\n<li>服务监控：监视当前系统CPU、内存、磁盘、堆栈等相关信息。</li>\n<li>缓存监控：对系统的缓存查询，查看、清理等操作。</li>\n<li>在线构建器：拖动表单元素生成相应的HTML代码。</li>\n<li>连接池监视：监视当期系统数据库连接池状态，可进行分析SQL找出系统性能瓶颈。</li>\n</ul>\n<h3 id=\"主要特性\">止戈简介</h3>\n<p>止戈建站系统是一款基于JAVA开发的建站系统，上手简单，支持不同站点的建设。包括个人博客，公司官网，论坛，优惠卷推广等等。&nbsp;目前同步至若依4.7.4，内容部分已完成，示例主题基本完成，基本能满足日常使用。</p>\n<ul>\n<li>模板：支持普通页面,数据页面以及一些案例模板,其中页面主要以HTML片段，模板可以是图片，文档等。</li>\n<li>主题：支持主题上传，主题设置，主题编辑，备份主题等。同时支持多主题同时运行，通过简单设置即可实现群站效果。</li>\n<li>栏目：前端菜单管理，支持多级树，可以应付复杂的导航，已支持额外SEO字段。</li>\n<li>分类：支持多级树，全可以应付复杂分类，已支持额外SEO字段。</li>\n<li>标签：标签用于标记特殊文章，已支持额外SEO字段。</li>\n<li>文章：支持多种编辑器，支持评论操作，支持额外SEO字段。</li>\n<li>评论：支持评论以及评论相关操作。</li>\n<li>储存：储存方面统一接口，文件可视化管理，方便后续的维护以及扩展。</li>\n<li>邮件：邮件支持在线配置，发送，支持多种类型邮件发送，同时支持定时发送。</li>\n<li>链接：支持分组，方便做导航类网站。</li>\n<li>反馈: 支持不同类型反馈，方便搜集用户在使用中存在的问题。</li>\n<li>标签：使用Thymeleaf模板，可直接调用service，简化主题开发。</li>\n<li>API：提供简单API，方便单页主题的制作。</li>\n<li>联盟：支持淘宝，京东，拼多多商品推广。</li>\n</ul>\n<h2 id=\"mcetoc_1g9seq6p03\">系统需求</h2>\n<ul>\n<li>JDK &gt;= 1.8</li>\n<li>MySQL &gt;= 5.7</li>\n<li>Maven &gt;= 3.0</li>\n</ul>\n<h2 id=\"mcetoc_1g9rh8evmc\">项目地址</h2>\n<p>项目目前托管在码云，有喜欢的小伙伴可以前去看看，下载下来使用一下，体验默认账号密码admin/admin123。</p>\n<ul>\n<li style=\"list-style-type: initial;\">后台地址：<a href=\"https://gitee.com/Getawy/zhige\" target=\"_blank\" rel=\"noopener\">https://gitee.com/Getawy/zhige</a></li>\n<li style=\"list-style-type: initial;\">主题地址：<a href=\"https://gitee.com/Getawy/zgblog\" target=\"_blank\" rel=\"noopener\">https://gitee.com/Getawy/zgblog</a></li>\n<li style=\"list-style-type: initial;\">主题预览地址：<a href=\"https://pingpinduo.site\">https://pingpinduo.site</a></li>\n<li style=\"list-style-type: initial;\">后台预览地址：<a href=\"https://pingpinduo.site/admin\" target=\"_blank\" rel=\"noopener\">https://pingpinduo.site/admin</a></li>\n</ul>\n<h2 id=\"mcetoc_1g9rh8evmc\">注意事项</h2>\n<div>\n<ul>\n<li>预览账号为为管理账号，望千万不要手欠，请勿随意修改删除预览数据。</li>\n<li>如果项目对你有帮助，请点下小红星⭐表示支持，谢谢！</li>\n<li>qq群号：893754716</li>\n</ul>\n</div>\n<p>&nbsp;</p>',2,0,'','系统简介',3,1,'','1659766437131','止戈文档,止戈建站系统','',NULL),(16,'系统安装',1,'2022-08-07 23:20:20',1,'2022-08-13 14:22:52',1,'<div class=\"markdown-toc\">\n<h2>目录</h2>\n<ul>\n<li><a href=\"#mcetoc_1g9rh8evmd\">目录说明</a></li>\n<li><a href=\"#mcetoc_1g9rh8evme\"> 项目安装</a>\n<ul>\n<li><a href=\"#mcetoc_1g9rh8evmf\">准备工作</a></li>\n<li><a href=\"#mcetoc_1g9rh8evmg\">必要配置</a></li>\n<li><a href=\"#mcetoc_1g9rh8evmh\">运行系统</a></li>\n</ul>\n</li>\n</ul>\n</div>\n<h2 id=\"mcetoc_1g9rh8evmd\">目录说明</h2>\n<p>若依部分模块有分拆，有按照项目需求有修改，止戈建站系统项目目录结构大致如下：</p>\n<pre class=\"language-java\"><code>zhige\n ├── bin\n ├── doc\n ├── LICENSE\n ├── pom.xml\n ├── README.md\n ├── ruoyi-admin      管理模块\n ├── ruoyi-common     通用工具类\n ├── ruoyi-framework  项目核心\n ├── ruoyi-generator  代码生成\n ├── ruoyi-mail       邮件模块\n ├── ruoyi-mybatis    数据连接\n ├── ruoyi-oly\n │   ├── oly-cms      内容聚合模块\n │   │   ├── cms-admin   管内容理\n │   │   ├── cms-comment  评论\n │   │   ├── cms-common    通用工具\n │   │   ├── cms-general   通用服务\n │   │   ├── cms-hander    控制模块\n │   │   ├── cms-web       前端模块\n ├── ruoyi-oss        储存模块\n ├── ruoyi-quartz     定时任务\n ├── ruoyi-system\n │   ├── system-config 配置模块\n │   ├── system-core   系统模块\n │   └── system-dict   字典模块\n ├── ruoyi-template   模板模块\n ├── ry.bat\n ├── ry.sh\n └── sql   数据库脚本</code></pre>\n<h2 id=\"mcetoc_1g9rh8evme\"><br>项目安装</h2>\n<h3 id=\"mcetoc_1g9rh8evmf\">准备工作</h3>\n<p>为了让系统能正常运行，运行前请按照如下要求来</p>\n<ul>\n<li>环境要求</li>\n</ul>\n<pre class=\"language-java\"><code>JDK &gt;= 1.8 (推荐1.8版本)\nMysql &gt;= 5.7.0 (推荐5.7版本)\nMaven &gt;= 3.0</code></pre>\n<ul>\n<li style=\"list-style-type: initial;\">项目默认工作目录在用户目录/.ruoyi目录下，同级目录config用于存放覆盖默认配置的一些文件。</li>\n<li style=\"list-style-type: initial;\">系统已经集成flyway,因此只需要建数据库即可，如果是在Linux下运行本程序,由于Mysql默认大小写敏感,运行时会导致quartz找不到表，导致本程序无法启动。所以在安装数据库时配置lower_case_table_names=1,避免再次折腾,寻找解决方案。</li>\n</ul>\n<h3 id=\"mcetoc_1g9rh8evmg\">必要配置</h3>\n<ul>\n<li>修改数据库连接，编辑模块ruoyi-mybatis下的application-prodMybatis.yml，修改数据库信息</li>\n</ul>\n<pre class=\"language-java\"><code># 数据源配置\nspring:\n    config:\n      activate: \n        on-profile: prodMybatis\n    datasource:\n        type: com.alibaba.druid.pool.DruidDataSource\n        driverClassName: com.mysql.cj.jdbc.Driver\n        druid:\n            # 主库数据源\n            master:\n                url: jdbc:mysql://127.0.0.1:3306/xxxx?useUnicode=true&amp;characterEncoding=utf8&amp;zeroDateTimeBehavior=convertToNull&amp;useSSL=true&amp;serverTimezone=GMT%2B8\n                username: xxxx\n                password: xxxx\n            # 从库数据源\n            slave:\n                # 从数据源开关/默认关闭\n                enabled: false\n                url: \n                username: \n                password: \n            # 初始连接数\n            initialSize: 5\n            # 最小连接池数量\n            minIdle: 10\n            # 最大连接池数量\n            maxActive: 20\n            # 配置获取连接等待超时的时间\n            maxWait: 60000\n            # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n            timeBetweenEvictionRunsMillis: 60000\n            # 配置一个连接在池中最小生存的时间，单位是毫秒\n            minEvictableIdleTimeMillis: 300000\n            # 配置一个连接在池中最大生存的时间，单位是毫秒\n            maxEvictableIdleTimeMillis: 900000\n            # 配置检测连接是否有效\n            validationQuery: SELECT 1 FROM DUAL\n            testWhileIdle: true\n            testOnBorrow: false\n            testOnReturn: false\n            webStatFilter: \n                enabled: true\n            statViewServlet:\n                enabled: true\n                # 设置白名单，不填则允许所有访问\n                allow:\n                url-pattern: /druid/*\n                # 控制台管理用户名和密码\n                login-username: ruoyi\n                login-password: 123456\n            filter:\n                stat:\n                    enabled: true\n                    # 慢SQL记录\n                    log-slow-sql: true\n                    slow-sql-millis: 1000\n                    merge-sql: true\n                wall:\n                    config:\n                        multi-statement-allow: true\n# MyBatis\nmybatis:\n    # 搜索指定包别名\n    typeAliasesPackage: com.ruoyi.**.domain\n    # 配置mapper的扫描，找到所有的mapper.xml映射文件\n    mapperLocations: classpath*:mapper/**/*Mapper.xml\n    # 加载全局的配置文件\n    configLocation: classpath:mybatis/mybatis-config.xml\n\n# PageHelper分页插件\npagehelper: \n  helperDialect: mysql\n  supportMethodsArguments: true\n  params: count=countSql </code></pre>\n<ul>\n<li>修改服务器配置，编辑模块ruoyi-admin下的application.yml修改服务器配置</li>\n</ul>\n<pre class=\"language-java\"><code># 项目相关配置\nzg:\n  # 名称\n  name: ZhiGe\n  # 版本\n  version: 4.7.3\n  # 版权年份\n  copyrightYear: 2021\n  # 是否指定任意目录\n  appointProfile: false\n  # 储存相关根目录\n  profile: .zg\n  # 获取ip地址开关\n  addressEnabled: false\n# 开发环境配置\nserver:\n  # 服务器的HTTP端口，默认为8090\n  port: 8090\n  servlet:\n    # 应用的访问路径\n    context-path: /\n    encoding:\n      enabled: true\n      charset: UTF-8\n      force: true\n  tomcat:\n    # tomcat的URI编码\n    uri-encoding: UTF-8\n    # 连接数满后的排队数，默认为100\n    accept-count: 1000\n    threads:\n      # tomcat最大线程数，默认为200\n      max: 800\n      # Tomcat启动初始化的线程数，默认值10\n      min-spare: 100\n \n# 日志配置\nlogging:\n  level:\n    com.ruoyi: debug\n    org.springframework: warn\n    com.oly: debug \n# 用户配置\nuser:\n  password:\n    # 密码错误{maxRetryCount}次锁定10分钟\n    maxRetryCount: 5\n\n# Spring配置\nspring:\n  # 模板引擎\n  thymeleaf:\n    mode: HTML\n    encoding: utf-8\n    # 禁用缓存\n    cache: false\n    prefix: classpath:/templates/\n    template-resolver-order: 1\n  # 资源信息\n  messages:\n    # 国际化资源文件路径\n    basename: static/i18n/messages\n  jackson:\n    time-zone: GMT+8\n    date-format: yyyy-MM-dd HH:mm:ss\n  profiles: \n    active: prod\n    group: \n      \"prod\": \"prodMybatis,prodFlyway\"\n  # 文件上传\n  servlet:\n     multipart:\n      # 文件上传开关默认 true\n       enabled: true\n       # 文件延迟解析默认 false\n       resolve-lazily: false\n       # 文件写入磁盘阙值默认 0 \n       file-size-threshold: 0\n       # 临时目录\n       location: ${tmp_path}\n       # 单个文件大小\n       max-file-size:  10MB\n       # 设置总上传的文件大小\n       max-request-size:  20MB\n      \n      \n  # 服务模块\n  devtools:\n    restart:\n      # 热部署开关\n      enabled: true\n  cache:\n    type: ehcache\n    ehcache:\n      config: classpath:ehcache/ehcache-shiro.xml\n  mvc:\n    pathmatch:\n      matching-strategy: ant-path-matcher\n\n# Shiro\nshiro:\n  user:\n    # 登录地址\n    loginUrl: /login\n    # 权限认证失败地址\n    unauthorizedUrl: /unauth\n    # 首页地址\n    indexUrl: /index\n    # 管理地址\n    adminUrl: /admin\n    # 验证码开关\n    captchaEnabled: true\n    # 验证码类型 math 数组计算 char 字符\n    captchaType: math\n  cookie:\n    # 设置Cookie的域名 默认空，即当前访问的域名\n    domain: \n    # 设置cookie的有效访问路径\n    path: /\n    # 设置HttpOnly属性\n    httpOnly: true\n    # 设置Cookie的过期时间，天为单位\n    maxAge: 30\n    # 设置密钥，务必保持唯一性（生成方式，直接拷贝到main运行即可）Base64.encodeToString(CipherUtils.generateNewKey(128, \"AES\").getEncoded()) （默认启动生成随机秘钥，随机秘钥会导致之前客户端RememberMe Cookie无效，如设置固定秘钥RememberMe Cookie则有效）\n    cipherKey: \n  session:\n    # Session超时时间，-1代表永不过期（默认30分钟）\n    expireTime: 30\n    # 同步session到数据库的周期（默认1分钟）\n    dbSyncPeriod: 1\n    # 相隔多久检查一次session的有效性，默认就是10分钟\n    validationInterval: 10\n    # 同一个用户最大会话数，比如2的意思是同一个账号允许最多同时两个人登录（默认-1不限制）\n    maxSession: -1\n    # 踢出之前登录的/之后登录的用户，默认踢出之前登录的用户\n    kickoutAfter: false\n  rememberMe:\n    # 是否开启记住我\n    enabled: true\n\n# 防止XSS攻击\nxss: \n  # 过滤开关\n  enabled: true\n  # 排除链接（多个用逗号分隔）\n  excludes: /system/notice/*,/cms/*\n  # 匹配链接\n  urlPatterns: /system/*,/monitor/*,/tool/*\n\n# Swagger配置\nswagger:\n  # 是否开启swagger\n  enabled: true\n</code></pre>\n<h3 id=\"mcetoc_1g9rh8evmh\">运行系统</h3>\n<ul>\n<li>确保mysql服务开启，数据库已经创建</li>\n<li>系统启动入口位于ruoyi-admin，打开项目运行com.ruoyi.RuoYiApplication.java</li>\n<li>项目启动成功后将会看到如下输出：\n<pre class=\"language-java\"><code>ZZZZZZZZZZZZZZZZZZZ        GGGGGGGGGGGGG\nZ:::::::::::::::::Z     GGG::::::::::::G\nZ:::::::::::::::::Z   GG:::::::::::::::G\nZ:::ZZZZZZZZ:::::Z   G:::::GGGGGGGG::::G\nZZZZZ     Z:::::Z   G:::::G       GGGGGG\n        Z:::::Z    G:::::G\n   止  Z:::::Z     G:::::G      戈\n      Z:::::Z      G:::::G    GGGGGGGGGG\n     Z:::::Z       G:::::G    G::::::::G\n    Z:::::Z        G:::::G    GGGGG::::G\nZ:::::Z        Z:::::::::G        G::::G\nZZZ:::::Z     ZZZZZ G:::::G       G::::G\nZ::::::ZZZZZZZZ:::Z  G:::::GGGGGGGG::::G\nZ:::::::::::::::::Z   GG:::::::::::::::G\nZ:::::::::::::::::Z     GGG::::::GGG:::G\nZZZZZZZZZZZZZZZ  启动成功 GGGGGG    GGGG</code></pre>\n</li>\n<li>打开浏览器输入打开浏览器，输入：127.0.0.1:8090（默认账户:密码 admin/admin123）<br>若能正确展示登录页面，并能成功登录，菜单及页面展示正常，则表明环境搭建成功&nbsp;</li>\n<li>默认系统未安装主题，需要手动安装。</li>\n</ul>',2,0,'','系统安装',3,1,'','1659885499422','系统安装,止戈文档','',NULL);
