--
-- Table structure for table `sys_notice`
--

DROP TABLE IF EXISTS `sys_notice`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `sys_notice` (
  `notice_id` int(4) NOT NULL AUTO_INCREMENT COMMENT '公告ID',
  `notice_title` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '公告标题',
  `notice_type` char(1) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '公告类型（1通知 2公告）',
  `notice_content` text CHARACTER SET utf8 COLLATE utf8_unicode_ci COMMENT '公告内容',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '0' COMMENT '公告状态（0正常 1关闭）',
  `create_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`notice_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='通知公告表';
/*!40101 SET character_set_client = @saved_cs_client */;

--
-- Dumping data for table `sys_notice`
--

LOCK TABLES `sys_notice` WRITE;
/*!40000 ALTER TABLE `sys_notice` DISABLE KEYS */;
INSERT INTO `sys_notice` VALUES (1,'温馨提醒：2018-07-01 若依新版本发布啦','2','<p><img src=\"http://127.0.0.1:8090/oss/download/image/2022/07/14/20171226174749239_20220714201213A001.png\" style=\"width: 973px;\" data-filename=\"20171226174749239.png\"><br></p>','0','admin','2022-01-13 08:17:25','admin','2022-07-14 20:12:16','管理员'),(2,'维护通知：2018-07-01 若依系统凌晨维护','1','<p style=\"margin-right: 0em; margin-bottom: 16px; margin-left: 0em; line-height: 1.6; word-break: break-word; color: rgb(64, 72, 91); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, SimSun, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; font-size: 16px;\">目前同步至若依4.7.4,内容部分已经基本完成。</p><ul style=\"padding-left: 2em; margin-bottom: 16px; padding-bottom: 1px; color: rgb(64, 72, 91); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, SimSun, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; font-size: 16px;\"><li style=\"list-style: initial;\">模板：支持普通页面,数据页面以及一些案例模板,其中页面主要以HTML片段，案例模板可以是图片，文档等等。HTML片段方便系统维护及管理，案例模板则可以规范站点内容的维护或者各种单子发票的统一。</li><li style=\"list-style: initial; margin-top: 0.25em;\">主题：支持主题上传,切换以及个性化设置,备份主题,支持多主题。通过简单配置,即可实现实现群站效果。</li><li style=\"list-style: initial; margin-top: 0.25em;\">栏目：前端菜单管理,支持多级树,可以应付复杂的导航,已支持额外SEO字段。</li><li style=\"list-style: initial; margin-top: 0.25em;\">分类：支持多级树,完全可以应付复杂分类,已支持额外SEO字段。</li><li style=\"list-style: initial; margin-top: 0.25em;\">标签：标签用于标记文章特色,已支持额外SEO字段。</li><li style=\"list-style: initial; margin-top: 0.25em;\">文章：支持不同类型,特色推荐,多关键字的文章发布,支持额外SEO字段。</li><li style=\"list-style: initial; margin-top: 0.25em;\">储存：储存方面统一接口,文件可视化管理,方便后续的维护以及扩展。</li><li style=\"list-style: initial; margin-top: 0.25em;\">邮件：邮件支持在线配置,发送,支持多种类型邮件发送,支持定时发送。</li><li style=\"list-style: initial; margin-top: 0.25em;\">链接：支持分组,方便做导航类网站。</li><li style=\"list-style: initial; margin-top: 0.25em;\">文章：包含评论,浏览记录,评分,收藏等。</li><li style=\"list-style: initial; margin-top: 0.25em;\">反馈: 支持不同类型反馈,方便搜集用户在使用中存在的问题。</li><li style=\"list-style: initial; margin-top: 0.25em;\">标签：使用Thymeleaf模板,可直接调用service,简化主题开发</li></ul><hr style=\"height: 0.25em; margin: 24px 0px; background: rgb(225, 228, 232); border-top: 0px; border-bottom-color: rgb(238, 238, 238); padding: 0px; color: rgb(64, 72, 91); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, SimSun, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; font-size: 16px;\"><h2 style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, SimSun, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; line-height: 1.25; margin: 24px 0em 16px; font-weight: 600; padding: 0em; font-size: 1.5em; position: relative; color: rgb(64, 72, 91);\"><a id=\"user-content-目录说明\" class=\"anchor\" href=\"https://gitee.com/Getawy/zhige#%E7%9B%AE%E5%BD%95%E8%AF%B4%E6%98%8E\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(9, 94, 171); overflow-wrap: break-word; float: left; padding-right: 4px; margin-left: -20px; line-height: 1; display: block; padding-left: 30px; position: absolute; top: 0px; left: 0px; bottom: 0px; outline: none;\"></a>目录说明</h2><div class=\"white\" style=\"color: rgb(64, 72, 91); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, SimSun, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; font-size: 16px;\"><div class=\"highlight markdown-code-block\" style=\"margin-bottom: 16px; position: relative;\"><pre style=\"font-family: SFMono-Regular, Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 13.6px; margin-bottom: 0px; overflow-wrap: normal; padding: 16px; line-height: 1.45; background-color: rgb(246, 248, 250); border-radius: 3px; word-break: normal; min-height: 52px; tab-size: 4;\"><span id=\"LC1\" class=\"line\" style=\"position: relative;\">RuoYi</span>\r\n<span id=\"LC2\" class=\"line\" style=\"position: relative;\"> ├── bin</span>\r\n<span id=\"LC3\" class=\"line\" style=\"position: relative;\"> ├── doc</span>\r\n<span id=\"LC4\" class=\"line\" style=\"position: relative;\"> ├── LICENSE</span>\r\n<span id=\"LC5\" class=\"line\" style=\"position: relative;\"> ├── pom.xml</span>\r\n<span id=\"LC6\" class=\"line\" style=\"position: relative;\"> ├── README.md</span>\r\n<span id=\"LC7\" class=\"line\" style=\"position: relative;\"> ├── ruoyi-admin      管理模块</span>\r\n<span id=\"LC8\" class=\"line\" style=\"position: relative;\"> ├── ruoyi-common     通用工具类</span>\r\n<span id=\"LC9\" class=\"line\" style=\"position: relative;\"> ├── ruoyi-framework  项目核心</span>\r\n<span id=\"LC10\" class=\"line\" style=\"position: relative;\"> ├── ruoyi-generator  代码生成</span>\r\n<span id=\"LC11\" class=\"line\" style=\"position: relative;\"> ├── ruoyi-mail       邮件模块</span>\r\n<span id=\"LC12\" class=\"line\" style=\"position: relative;\"> ├── ruoyi-mybatis    数据连接</span>\r\n<span id=\"LC13\" class=\"line\" style=\"position: relative;\"> ├── ruoyi-oly</span>\r\n<span id=\"LC14\" class=\"line\" style=\"position: relative;\"> │   ├── oly-cms      内容聚合模块</span>\r\n<span id=\"LC15\" class=\"line\" style=\"position: relative;\"> │   │   ├── cms-admin   管内容理</span>\r\n<span id=\"LC16\" class=\"line\" style=\"position: relative;\"> │   │   ├── cms-comment  评论</span>\r\n<span id=\"LC17\" class=\"line\" style=\"position: relative;\"> │   │   ├── cms-common    通用工具</span>\r\n<span id=\"LC18\" class=\"line\" style=\"position: relative;\"> │   │   ├── cms-general   通用服务</span>\r\n<span id=\"LC19\" class=\"line\" style=\"position: relative;\"> │   │   ├── cms-hander    控制模块</span>\r\n<span id=\"LC20\" class=\"line\" style=\"position: relative;\"> │   │   ├── cms-web       前端模块</span>\r\n<span id=\"LC21\" class=\"line\" style=\"position: relative;\"> ├── ruoyi-oss        储存模块</span>\r\n<span id=\"LC22\" class=\"line\" style=\"position: relative;\"> ├── ruoyi-quartz     定时任务</span>\r\n<span id=\"LC23\" class=\"line\" style=\"position: relative;\"> ├── ruoyi-system</span>\r\n<span id=\"LC24\" class=\"line\" style=\"position: relative;\"> │   ├── system-config 配置模块</span>\r\n<span id=\"LC25\" class=\"line\" style=\"position: relative;\"> │   ├── system-core   系统模块</span>\r\n<span id=\"LC26\" class=\"line\" style=\"position: relative;\"> │   └── system-dict   字典模块</span>\r\n<span id=\"LC27\" class=\"line\" style=\"position: relative;\"> ├── ruoyi-template   模板模块</span>\r\n<span id=\"LC28\" class=\"line\" style=\"position: relative;\"> ├── ry.bat</span>\r\n<span id=\"LC29\" class=\"line\" style=\"position: relative;\"> ├── ry.sh</span>\r\n<span id=\"LC30\" class=\"line\" style=\"position: relative;\"> └── sql   数据库脚本</span></pre><div class=\"markdown-code-block-copy-btn\" style=\"font-size: 14px; font-family: iconfont; width: 24px; height: 24px; line-height: 24px; text-align: center; border-radius: 3px; border: 1px solid rgb(220, 227, 232); background: rgb(246, 248, 250); position: absolute; right: 12px; top: 12px; cursor: pointer; color: rgb(140, 146, 164); opacity: 0; transition: all 0.3s ease 0s;\"></div></div></div><h2 style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, SimSun, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; line-height: 1.25; margin: 24px 0em 16px; font-weight: 600; padding: 0em; font-size: 1.5em; position: relative; color: rgb(64, 72, 91);\"><a id=\"user-content-安装运行\" class=\"anchor\" href=\"https://gitee.com/Getawy/zhige#%E5%AE%89%E8%A3%85%E8%BF%90%E8%A1%8C\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(9, 94, 171); overflow-wrap: break-word; float: left; padding-right: 4px; margin-left: -20px; line-height: 1; display: block; padding-left: 30px; position: absolute; top: 0px; left: 0px; bottom: 0px; outline: none;\"></a>安装$运行</h2><ul style=\"padding-left: 2em; margin-bottom: 16px; padding-bottom: 1px; color: rgb(64, 72, 91); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, SimSun, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; font-size: 16px;\"><li style=\"list-style: initial;\">项目默认工作目录在用户目录/.ruoyi目录下,同级目录config用于存放覆盖默认配置的一些文件。</li><li style=\"list-style: initial; margin-top: 0.25em;\">系统已经集成flyway,因此只需要建数据库即可，如果是在Linux下运行本程序,由于Mysql默认大小写敏感,运行时会导致quartz找不到表，导致本程序无法启动。所以在安装数据库时配置lower_case_table_names=1,避免再次折腾,寻找解决方案。</li></ul><h3 style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, SimSun, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; line-height: 1.25; margin: 24px 0em 16px; padding: 0em; font-size: 1.25em; position: relative; color: rgb(64, 72, 91);\"><a id=\"user-content-配置\" class=\"anchor\" href=\"https://gitee.com/Getawy/zhige#%E9%85%8D%E7%BD%AE\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(9, 94, 171); overflow-wrap: break-word; float: left; padding-right: 4px; margin-left: -20px; line-height: 1; display: block; padding-left: 30px; position: absolute; top: 0px; left: 0px; bottom: 0px; outline: none;\"></a>配置</h3><ol style=\"padding-left: 2em; margin-bottom: 16px; padding-bottom: 1px; color: rgb(64, 72, 91); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, SimSun, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; font-size: 16px;\"><li style=\"list-style: decimal;\">默认方式 本程序所有操作,在用户工作目录的/.zgcms下。包括日志记录,主题文件,本地文件储存,备份文件等等...默认配置如下：</li></ol><div class=\"white\" style=\"color: rgb(64, 72, 91); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, SimSun, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; font-size: 16px;\"><div class=\"highlight markdown-code-block\" style=\"margin-bottom: 16px; position: relative;\"><pre style=\"font-family: SFMono-Regular, Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 13.6px; margin-bottom: 0px; overflow-wrap: normal; padding: 16px; line-height: 1.45; background-color: rgb(246, 248, 250); border-radius: 3px; word-break: normal; min-height: 52px; tab-size: 4;\"><span id=\"LC1\" class=\"line\" style=\"position: relative;\">ruoyi:</span>\r\n<span id=\"LC2\" class=\"line\" style=\"position: relative;\">  # 名称</span>\r\n<span id=\"LC3\" class=\"line\" style=\"position: relative;\">  name: zgcms</span>\r\n<span id=\"LC4\" class=\"line\" style=\"position: relative;\">  # 版本</span>\r\n<span id=\"LC5\" class=\"line\" style=\"position: relative;\">  version: 4.7.3</span>\r\n<span id=\"LC6\" class=\"line\" style=\"position: relative;\">  # 版权年份</span>\r\n<span id=\"LC7\" class=\"line\" style=\"position: relative;\">  copyrightYear: 2021</span>\r\n<span id=\"LC8\" class=\"line\" style=\"position: relative;\">  # 实例演示开关</span>\r\n<span id=\"LC9\" class=\"line\" style=\"position: relative;\">  demoEnabled: true</span>\r\n<span id=\"LC10\" class=\"line\" style=\"position: relative;\">  # 是否指定任意目录</span>\r\n<span id=\"LC11\" class=\"line\" style=\"position: relative;\">  appointProfile: false</span>\r\n<span id=\"LC12\" class=\"line\" style=\"position: relative;\">  # 储存相关根目录</span>\r\n<span id=\"LC13\" class=\"line\" style=\"position: relative;\">  profile: .zgcms</span>\r\n<span id=\"LC14\" class=\"line\" style=\"position: relative;\">  # 获取ip地址开关</span>\r\n<span id=\"LC15\" class=\"line\" style=\"position: relative;\">  addressEnabled: false</span></pre><div class=\"markdown-code-block-copy-btn\" style=\"font-size: 14px; font-family: iconfont; width: 24px; height: 24px; line-height: 24px; text-align: center; border-radius: 3px; border: 1px solid rgb(220, 227, 232); background: rgb(246, 248, 250); position: absolute; right: 12px; top: 12px; cursor: pointer; color: rgb(140, 146, 164); opacity: 1; transition: all 0.3s ease 0s;\"></div></div></div><ol start=\"2\" style=\"padding-left: 2em; margin-bottom: 16px; padding-bottom: 1px; color: rgb(64, 72, 91); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, SimSun, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; font-size: 16px;\"><li style=\"list-style: decimal;\">指定目录</li></ol><ul style=\"padding-left: 2em; margin-bottom: 16px; padding-bottom: 1px; color: rgb(64, 72, 91); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, SimSun, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; font-size: 16px;\"><li style=\"list-style: initial;\">不指定任意目录，依旧在用户工作目录下</li></ul>','0','admin','2022-01-13 08:17:25','admin','2022-07-16 13:13:27','管理员');
