ystem.SysConfigController.editByGkSaves()','POST',1,'admin','研发部门','/system/config/updateByGk','127.0.0.1','内网IP','{\"oly.comment.open\":[\"true\"],\"oly.comment.reply\":[\"\"],\"oly.comment.defauleVisible\":[\"0\"],\"oly.comment.oneSize\":[\"10\",\"10\"],\"configGroup\":[\"commentConfig\"]}','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-07-02 19:55:04'),(1049,'参数管理',2,'com.ruoyi.web.controller.system.SysConfigController.editByGkSaves()','POST',1,'admin','研发部门','/system/config/updateByGk','127.0.0.1','内网IP','{\"oly.comment.open\":[\"false\"],\"oly.comment.reply\":[\"\"],\"oly.comment.defauleVisible\":[\"0\"],\"oly.comment.oneSize\":[\"10\",\"10\"],\"configGroup\":[\"commentConfig\"]}','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-07-02 20:11:11'),(1050,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"5\"],\"articleTitle\":[\"test22\"],\"articleUrl\":[\"1653588954255\"],\"keywords\":[\"fdvfdgfd\"],\"editor-markdown-doc\":[\"# 基本介绍\\r\\n- 止戈建站系统是一款用于开发网站的软件，基本能满足一般的个人网站，个人博客，公司网站，资讯网站，论坛等网站的开发与维护。\\r\\n- 其制作过程只需要关注前端部分的展示，稍加学习，即可制作出满足大多数需求的网站。如若有特殊需求，也可以自主进行开发。\\r\\n- 支持多套主题同时运行，也可以多套主题共享数据，也可以后台进行简单的数据配置，主题之间数据隔离，可达到群站的效果。\\r\\n- 内置权限系统，基本能满足大多数应用场景，通过简单的权限配置，以应对不同人员对网站数据的编辑需求。\\r\\n- 基于若依，基础模块完善，内容模块完善，方便便后续二次开发。\\r\\n- 基于Java开发，主要使用的框架是Spring Boot、安全框架Apache Shiro、使用模板Thymeleaf+hplus、使用缓存Ehcache、数据库使用的是MySQL，MyBatis用于数据操作、同时系统支持Flyway，主要用于数据初始化以及迁移。\\r\\n# 项目目录\\r\\n# 项目安装\\r\\n# 项目预览\\r\\n# 项目地址\\r\\n- [后台地址](https://gitee.com/Getawy/zhige)\\r\\n- [主题地址](https://gitee.com/Getawy/zgblog)\\r\\n- [主题预览地址](pingpinduo.site)\\r\\n- [后台预览地址](pingpinduo.site/admin)\"],\"editor-html-code\":[\"<h1 id=\\\"h1-u57FAu672Cu4ECBu7ECD\\\"><a name=\\\"基本介绍\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>基本介绍</h1><ul>\\r\\n<li>止戈建站系统是一款用于开发网站的软件，基本能满足一般的个人网站，个人博客，公司网站，资讯网站，论坛等网站的开发与维护。</li><li>其制作过程只需要关注前端部分的展示，稍加学习，即可制作出满足大多数需求的网站。如若有特殊需求，也可以自主进行开发。</li><li>支持多套主题同时运行，也可以多套主题共享数据，也可以后台进行简单的数据配置，主题之间数据隔离，可达到群站的效果。</li><li>内置权限系统，基本能满足大多数应用场景，通过简单的权限配置，以应对不同人员对网站数据的编辑需求。</li><li>基于若依，基础模块完善，内容模块完善，方便便后续二次开发。</li><li>基于Java开发，主要使用的框架是Spring Boot、安全框架Apache Shiro、使用模板Thymeleaf+hplus、使用缓存Ehcache、数据库使用的是MySQL，MyBatis用于数据操作、同时系统支持Flyway，主要用于数据初始化以及迁移。<h1 id=\\\"h1-u9879u76EEu76EEu5F55\\\"><a name=\\\"项目目录\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>项目目录</h1><h1 id=\\\"h1-u9879u76EEu5B89u88C5\\\"><a name=\\\"项目安装\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>项目安装</h1><h1 id=\\\"h1-u9879u76EEu9884u89C8\\\"><a name=\\\"项目预览\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>项目预览</h1><h1 id=\\\"h1-u9879u76EEu5730u5740\\\"><a name=\\\"项目地址\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>项目地址</h1></li><li><a href=\\\"https://gitee.com/Getawy/zhige\\\">后台地址</a></li',NULL,1,'参数验证校验失败,请检查！','2022-07-03 22:31:25'),(1051,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"5\"],\"articleTitle\":[\"test22\"],\"articleUrl\":[\"1653588954255\"],\"keywords\":[\"fdvfdgfd\"],\"editor-markdown-doc\":[\"# 基本介绍\\r\\n- 止戈建站系统是一款用于开发网站的软件，基本能满足一般的个人网站，个人博客，公司网站，资讯网站，论坛等网站的开发与维护。\\r\\n- 其制作过程只需要关注前端部分的展示，稍加学习，即可制作出满足大多数需求的网站。如若有特殊需求，也可以自主进行开发。\\r\\n- 支持多套主题同时运行，也可以多套主题共享数据，也可以后台进行简单的数据配置，主题之间数据隔离，可达到群站的效果。\\r\\n- 内置权限系统，基本能满足大多数应用场景，通过简单的权限配置，以应对不同人员对网站数据的编辑需求。\\r\\n- 基于若依，基础模块完善，内容模块完善，方便便后续二次开发。\\r\\n- 基于Java开发，主要使用的框架是Spring Boot、安全框架Apache Shiro、使用模板Thymeleaf+hplus、使用缓存Ehcache、数据库使用的是MySQL，MyBatis用于数据操作、同时系统支持Flyway，主要用于数据初始化以及迁移。\\r\\n# 项目目录\\r\\n# 项目安装\\r\\n# 项目预览\\r\\n# 项目地址\\r\\n- [后台地址](https://gitee.com/Getawy/zhige)\\r\\n- [主题地址](https://gitee.com/Getawy/zgblog)\\r\\n- [主题预览地址](pingpinduo.site)\\r\\n- [后台预览地