主要使用的框架是Spring Boot、安全框架Apache Shiro、使用模板Thymeleaf+hplus、使用缓存Ehcache、数据库使用的是MySQL，MyBatis用于数据操作、同时系统支持Flyway，主要用于数据初始化以及迁移。<h1 id=\\\"h1-u9879u76EEu76EEu5F55\\\"><a name=\\\"项目目录\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>项目目录</h1><h1 id=\\\"h1-u9879u76EEu5B89u88C5\\\"><a name=\\\"项目安装\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>项目安装</h1><h1 id=\\\"h1-u9879u76EEu9884u89C8\\\"><a name=\\\"项目预览\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>项目预览</h1><h1 id=\\\"h1-u9879u76EEu5730u5740\\\"><a name=\\\"项目地址\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>项目地址','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-07-21 14:35:35'),(1336,'文件管理',1,'com.oly.cms.admin.controller.page.CmsArticleController.articleImgUploadMarkdown()','POST',1,'admin','研发部门','/cms/article/articleImgByMarkdown','127.0.0.1','内网IP','{\"guid\":[\"1658385342688\"]}','\"{\\\"success\\\":1,\\\"message\\\":\\\"上传成功\\\",\\\"url\\\":\\\"http://127.0.0.1:8090/oss/download/image/2022/07/21/nav-icon-weal.active_20220721143547A003.png\\\"}\"',0,NULL,'2022-07-21 14:35:48'),(1337,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"1\"],\"articleTitle\":[\"test\"],\"articleUrl\":[\"1648444486926\"],\"keywords\":[\"test\"],\"editor-markdown-doc\":[\"![](http://127.0.0.1:8090/oss/download/image/2022/07/21/nav-icon-weal.active_20220721143547A003.png)dfvfvxcvcxvcxvcxvcvvxcvcvcvcxvxcvxccxc\"],\"editor-html-code\":[\"<p><img src=\\\"http://127.0.0.1:8090/oss/download/image/2022/07/21/nav-icon-weal.active_20220721143547A003.png\\\" alt=\\\"\\\">dfvfvxcvcxvcxvcxvcvvxcvcvcvcxvxcvxccxc\\r\\n\"],\"cats\":[\"1\"],\"tags\":[\"1\"],\"chooseTag\":[\"\"],\"articleType\":[\"3\"],\"allowComment\":[\"1\"],\"description\":[\"\"],\"re