 #d4d4d4;\\\">&nbsp;文章：包含评论,浏览记录,评分,收藏等。</span><span style=\\\"color: #6796e6;\\\">*</span><span style=\\\"color: #d4d4d4;\\\">&nbsp;反馈: 支持不同类型反馈,方便搜集用户在使用中存在的问题。</span><span style=\\\"color: #6796e6;\\\">*</span><span style=\\\"color: #d4d4d4;\\\">&nbsp;标签：使用Thymeleaf模板,可直接调用service','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-07-24 21:12:43'),(1487,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"3\"],\"articleTitle\":[\"测试文章\"],\"articleUrl\":[\"1653035901471\"],\"keywords\":[\"cvv\"],\"cats\":[\"2\"],\"tags\":[\"1\"],\"chooseTag\":[\"\"],\"articleType\":[\"3\"],\"allowComment\":[\"1\"],\"description\":[\"\"],\"reprintUrl\":[\"\"],\"articleImg\":[\"http://127.0.0.1:8090/oss/download/image/2022/07/21/44_20220721143509A001.png\"],\"articleContent\":[\"<p style=\'box-sizing: border-box; margin-top: 0px !important; margin-right: 0px; margin-bottom: 16px; margin-left: 0px; color: rgb(136, 136, 136); font-family: \\\"Microsoft YaHei\\\", Helvetica, \\\"Meiryo UI\\\", \\\"Malgun Gothic\\\", \\\"Segoe UI\\\", \\\"Trebuchet MS\\\", Monaco, monospace, Tahoma, STXihei, 华文细黑, STHeiti, \\\"Helvetica Neue\\\", \\\"Droid Sans\\\", \\\"wenquanyi micro hei\\\", FreeSans, Arimo, Arial, SimSun, 宋体, Heiti, 黑体, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><img data-fr-image-pasted=\\\"true\\\" src=\\\"http://127.0.0.1:8090/oss/download/image/2022/07/21/44_20220721143509A001.png\\\" alt=\\\"\\\" style=\\\"box-sizing: border-box; border: 0px; max-width: 100%;\\\" class=\\\"fr-fic fr-dii\\\">bnbvnbvnvbnvbnvnvbnvbnvbnvbnbbnvbn</p><h2 style=\'box-sizing: border-box; font-family: \\\"Microsoft YaHei\\\", Helvetica, \\\"Meiryo UI\\\", \\\"Malgun Gothic\\\", \\\"Segoe UI\\\", \\\"Trebuchet MS\\\", Monaco, monospace, Tahoma, STXihei, 华文细黑, STHeiti, \\\"Helvetica Neue\\\", \\\"Droid Sans\\\", \\\"wenquanyi micro hei\\\", FreeSans, Arimo, Arial, SimSun, 宋体, Heiti, 黑体, sans-serif; font-weight: bold; line-height: 1.225; color: rgb(136, 136, 136); margin-top: 1em; margin-bottom: 16px; font-size: 1.75em; position: relative; padding-bottom: 0.3em; border-bottom: 1px solid rgb(34, 34, 34); border-top-color: rgb(34, 34, 34); border-right-color: rgb(34, 34, 34)','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-07-24 21:14:04'),(1488,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"1\"],\"articleTitle\":[\"test\"],\"articleUrl\":[\"1648444486926\"],\"keywords\":[\"test\"],\"editor-markdown-doc\":[\"![](http://127.0.0.1:8090/oss/download/image/2022/07/21/nav-icon-weal.active_20220721143547A003.png)dfvfvxcvcxvcxvcxvcvvxcvcvcvcxvxcvxc\\r\\n## 止戈简介\\r\\n目前同步至若依4.7.4,内容部分已经基本完成。\\r\\n* 模板：支持普通页面,数据页面以及一些案例模板,其中页面主要以HTML片段，案例模板可以是图片，文档等等。HTML片段方便系统维护及管理，案例模板则可以规范站点内容的维护或者各种单子发票的统一。\\r\\n* 主题：支持主题上传,切换以及个性化设置,备份主题,支持多主题。通过简单配置,即可实现实现群站效果。\\r\\n* 栏目：前端菜单管理,支持多级树,可以应付复杂的导航,已支持额外SEO字段。\\r\\n* 分类：支持多级树,完全可以应付复杂分类,已支持额外SEO字段。\\r\\n* 标签：标签用于标记文章特色,已支持额外SEO字段。\\r\\n* 文章：支持不同类型,特色推荐,多关键字的文章发布,支持额外SEO字段。\\r\\n* 储存：储存方面统一接口,文件可视化管理,方便后续的维护以及扩展。\\r\\n* 邮件：邮件支持在线配置,发送,支持多种类型邮件发送,支持定时发送。\\r\\n* 链接：支持分组,方便做导航类网站。\\r\\n* 文章：包含评论,浏览记录,评分,收藏等。\\r\\n* 反馈: 支持不同类型反馈,方便搜集用户在使用中存在的问题。\\r\\n* 标签：使用Thymeleaf模板,可直接调用service,简化主题开发\\r\\n***\\r\\n\\r\\n## 目录说明\\r\\n```\\r\\nRuoYi\\r\\n ├── bin\\r\\n ├── doc\\r\\n ├── LICENSE\\r\\n ├── pom.xml\\r\\n ├── README.md\\r\\n ├── ruoyi-admin      管理模块\\r\\n ├── ruoyi-common     通用工具类\\r\\n ├── ruoyi-framework  项目核心\\r\\n ├── ruoyi-generator  代码生成\\r\\n ├── ruoyi-mail       邮件模块\\r\\n ├── ruoyi-mybatis    数据连接\\r\\n ├── ruoyi-oly\\r\\n │   ├── oly-cms      内容聚合模块\\r\\n │   │   ├── cms-admin   管内容理\\r\\n │   │   ├── cms-comment  评论\\r\\n │   │   ├── cms-common    通用工具\\r\\n │   │   ├── cms-general   通用服务\\r\\n │   │   ├── cms-hander    控制模块\\r\\n │   │   ├── cms-web       前端模块\\r\\n ├── ruoyi-oss        储存模块\\r\\n ├── ruoyi-quartz     定时任务\\r\\n ├── ruoyi-system\\r\\n │   ├── system-config 配置模块\\r\\n │   ├── system-core   系统模块\\r\\n │   └── system-dict   字典模块\\r\\n ├── ruoyi-template   模板模块\\r\\n ├── ry.bat\\r\\n ├── ry.sh\\r\\n └── sql   数据库脚本\\r\\n```\\r\\n\\r\\n## 安装$运行\\r\\n- 项目默认工作目录在用户目录/.ruoyi目录下,同级目录config用于存放覆盖默认配置的一些文件。\\r\\n- 系统已经集成flyway,因此只需要建数据库即可，如果是在Linux下运行本程序,由于Mysql默认大小写敏感,运行时会导致quartz找不到表，导致本程序无法启动。所以在安装数据库时配置lower_case_table_names=1,避免再次折腾,寻找解决方案。\\r\\n### 配置\\r\\n  1. 默认方式\\r\\n 本程序所有操作,在用户工作目录的/.zgcms下。包括日志记录,主题文件,本地文件储存,备份文件等等...默认配置如下：\\r\\n\\r\\n```\\r\\nruoyi:\\r\\n  # 名称\\r\\n  name: zgcms\\r\\n  # 版本\\r\\n  version: 4.7.3\\r\\n  # 版权年','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-07-24 21:20:01'),(1489,'分类管理',1,'com.oly.cms.admin.controller.page.CmsCatController.addSave()','POST',1,'admin','研发部门','/cms/cat/add','127.0.0.1','内网IP','{\"parentId\":[\"0\"],\"parent\":[\"0\"],\"catName\":[\"福利分类\"],\"catUrl\":[\"\"],\"catType\":[\"5\"],\"orderNum\":[\"3\"],\"visible\":[\"1\"],\"catIcon\":[\"\"],\"remark\":[\"联盟分类\"],\"keywords\":[\"\"],\"description\":[\"\"]}','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-07-24 22:10:30'),(1490,'分类管理',1,'com.oly.cms.admin.controller.page.CmsCatController.addSave()','POST',1,'admin','研发部门','/cms/cat/add','127.0.0.1','内网IP','{\"parentId\":[\"24\"],\"parent\":[\"1\"],\"catName\":[\"影音\"],\"catUrl\":[\"\"],\"catType\":[\"5\"],\"orderNum\":[\"0\"],\"visible\":[\"1\"],\"catIcon\":[\"\"],\"remark\":[\"\"],\"keywords\":[\"\"],\"description\":[\"\"]}','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-07-24 22:13:30'),(1491,'分类管理',2,'com.oly.cms.admin.controller.page.CmsCatController.editSave()','POST',1,'admin