\\n<pre>Banana,Orange,Apple,Mango</pre>\\n<p><a href=\\\"https://www.w3school.com.cn/tiy/t.asp?f=eg_js_array_tostring\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">亲自试一试</a></p>\\n<p><code>join()</code>&nbsp;方法也可将所有数组元素结合为一个字符串。</p>\\n<p>它的行为类似 toString()，但是您还可以规定分隔符：</p>\\n<h3 id=\\\"mcetoc_1g9087782k\\\">实例</h3>\\n<pre>var fruits = [\\\"Banana\\\", \\\"Orange\\\",\\\"Apple\\\", \\\"Mango\\\"];\\ndocument.getElementById(\\\"demo\\\").innerHTML = fruits.join(\\\" * \\\"); \\n</pre>\\n<p>结果</p>\\n<pre>Banana * Orange * Apple * Mango</pre>\\n<p><a href=\\\"https://www.w3school.com.cn/tiy/t.asp?f=eg_js_array_join\\\" target=\\\"_blank\\\" rel=','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-07-28 21:21:09'),(1583,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editVisible()','POST',1,'admin','研发部门','/cms/article/editVisible','127.0.0.1','内网IP','{\"visible\":[\"3\"],\"articleIds\":[\"12\"]}','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-07-28 21:31:31'),(1584,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"9\"],\"articleTitle\":[\"止戈简介\"],\"articleUrl\":[\"1658900998981\"],\"keywords\":[\"止戈文档,止戈说明\"],\"cats\":[\"2\"],\"tags\":[\"1\"],\"chooseTag\":[\"\"],\"articleType\":[\"0\"],\"allowComment\":[\"1\"],\"description\":[\"\"],\"reprintUrl\":[\"\"],\"articleImg\":[\"\"],\"articleContent\":[\"<div class=\\\"mce-toc\\\"><h2>目录</h2><ul><li><a href=\\\"#mcetoc_1g8v39mphj\\\"></a></li><li><a href=\\\"#mcetoc_1g8v39mphk\\\">止戈简介</a></li><li><a href=\\\"#mcetoc_1g8v39mphl\\\">目录说明</a></li><li><a href=\\\"#mcetoc_1g8v39mphm\\\">安装$运行</a><ul><li><a href=\\\"#mcetoc_1g8v39mphn\\\">配置</a></li></ul></li><li><a href=\\\"#mcetoc_1g8v39mpho\\\">注意事项</a></li><li><a href=\\\"#mcetoc_1g8v39mphp\\\">关于主题</a></li></ul></div><h2 id=\\\"mcetoc_1g8v39mphj\\\"><br></h2><h2 id=\\\"mcetoc_1g8v39mphk\\\">止戈简介</h2><p>目前同步至若依4.7.4,内容部分已经基本完成。</p><ul><li style=\\\"list-style-t