发\\r\\n***\\r\\n\\r\\n## 目录说明\\r\\n```\\r\\nRuoYi\\r\\n ├── bin\\r\\n ├── doc\\r\\n ├── LICENSE\\r\\n ├── pom.xml\\r\\n ├── README.md\\r\\n ├── ruoyi-admin      管理模块\\r\\n ├── ruoyi-common     通用工具类\\r\\n ├── ruoyi-framework  项目核心\\r\\n ├── ruoyi-generator  代码生成\\r\\n ├── ruoyi-mail       邮件模块\\r\\n ├── ruoyi-mybatis    数据连接\\r\\n ├── ruoyi-oly\\r\\n │   ├── oly-cms      内容聚合模块\\r\\n │   │   ├── cms-admin   管内容理\\r\\n │   │   ├── cms-comment  评论\\r\\n │   │   ├── cms-common    通用工具\\r\\n │   │   ├── cms-general   通用服务\\r\\n │   │   ├── cms-hander    控制模块\\r\\n │   │   ├── cms-web       前端模块\\r\\n ├── ruoyi-oss        储存模块\\r\\n ├── ruoyi-quartz     定时任务\\r\\n ├── ruoyi-system\\r\\n │   ├── system-config 配置模块\\r\\n │   ├── system-core   系统模块\\r\\n │   └── system-dict   字典模块\\r\\n ├── ruoyi-template   模板模块\\r\\n ├── ry.bat\\r\\n ├── ry.sh\\r\\n └── sql   数据库脚本\\r\\n```\\r\\n\\r\\n## 安装$运行\\r\\n- 项目默认工作目录在用户目录/.ruoyi目录下,同级目录config用于存放覆盖默认配置的一些文件。\\r\\n- 系统已经集成flyway,因此只需要建数据库即可，如果是在Linux下运行本程序,由于Mysql默认大小写敏感,运行时会导致quartz找不到表，导致本程序无法启动。所以在安装数据库时配置lower_case_table_names=1,避免再次折腾,寻找解决方案。\\r\\n### 配置\\r\\n  1. 默认方式\\r\\n 本程序所有操作,在用户工作目录的/.zgcms下。包括日志记录,主题文件,本地文件储存,备份文件等等...默认配置如下：\\r\\n\\r\\n```\\r\\nruoyi:\\r\\n  # 名称\\r\\n  name: zgcms\\r\\n  # 版本\\r\\n  version: 4.7.3\\r\\n  # 版权年','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-07-29 11:17:18'),(1590,'栏目管理',2,'com.oly.cms.admin.controller.page.CmsColumnController.edit()','POST',1,'admin','研发部门','/cms/column/edit','127.0.0.1','内网IP','{\"parentId\":[\"1\"],\"columnId\":[\"20\"],\"parent\":[\"0\"],\"columnName\":[\"福利\"],\"columnLocate\":[\"1\"],\"columnUrl\":[\"/custom/union\"],\"openType\":[\"1\"],\"orderNum\":[\"4\"],\"visible\":[\"1\"],\"perms\":[\"\"],\"columnIcon\":[\"\"],\"remark\":[\"优惠卷领取地址\"],\"keywords\":[\"\"],\"description\":[\"\"]}','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-07-30 12:10:31'),(1591,'栏目管理',1,'com.oly.cms.admin.controller.page.CmsColumnController.addSave()','POST',1,'admin','研发部门','/cms/column/a