\n<p>目前同步至若依4.7.4,内容部分已经基本完成。</p>\\n<ul>\\n<li>模板：支持普通页面,数据页面以及一些案例模板,其中页面主要以HTML片段，案例模板可以是图片，文档等等。HTML片段方便系统维护及管理，案例模板则可以规范站点内容的维护或者各种单子发票的统一。</li>\\n<li>主题：支持主题上传,切换以及个性化设置,备份主题,支持多主题。通过简单配置,即可实现实现群站效果。</li>\\n<li>栏目：前端菜单管理,支持多级树,可以应付复杂的导航,已支持额外SEO字段。</li>\\n<li>分类：支持多级树,完全可以应付复杂分类,已支持额外SEO字段。</li>\\n<li>标签：标签用于标记文章特色,已支持额外SEO字段。</li>\\n<li>文章：支持不同类型,特色推荐,多关键字的文章发布,支持额外SEO字段。</li>\\n<li>储存：储存方面统一接口,文件可视化管理,方便后续的维护以及扩展。</li>\\n<li>邮件：邮件支持在线配置,发送,支持多种类型邮件发送,支持定时发送。</li>\\n<li>链接：支持分组,方便做导航类网站。</li>\\n<li>文章：包含评论,浏览记录,评分,收藏等。</li>\\n<li>反馈: 支持不同类型反馈,方便搜集用户在使用中存在的问题。</li>\\n<li>标签：使用Thymeleaf模板,可直接调用service,简化主题开发</li>\\n</ul>\\n<hr>\\n<h2 id=\\\"h2-u76EEu5F55u8BF4u660E\\\"><a name=\\\"目录说明\\\"></a>目录说明</h2>\\n<ol>\\n<li style=\\\"list-style-type: decimal;\\\"><code>RuoYi</code></li>\\n<li style=\\\"list-style-type: decimal;\\\"><code> ├── bin</code></li>\\n<li style=\\\"list-style-type: decimal;\\\"><code> ├── doc</code></li>\\n<li style=\\\"list-style-type: decimal;\\\"><code> ├── LICENSE</code></li>\\n<li style=\\\"list-style-type: decimal;\\\"><code> ├── pom.xml</code></li>\\n<li style=\\\"list-style-type: decimal;\\\"><code> ├── README.md</code></li>\\n<li style=\\\"list-style-type: decimal;\\\"><code> ├── ruoyi-admin      管理模块</code></li>\\n<li style=\\\"list-style-type: decimal;\\\"><code> ├── ruoyi-common     通用工具类</code></li>\\n<li style=\\\"list-style-type: decimal;\\\"><code> ├── ruoyi-framework  项目核心</code></li>\\n<li style=\\\"list-style-type: decimal;\\\"><code> ├── ruoyi-generator  代码生成</code></li>\\n<li style=\\\"list-style-type: decimal;\\\"><code> ├── ruoyi-mail       邮件模块</code></li>\\n<li style=\\\"list-style-type: decimal;\\\"><code> ├── ruoyi-mybatis    数据连接</code></li>\\n<li style=\\\"list-style-type: decimal;\\\"><code> ├── ru','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-05 22:14:09'),(1685,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleI