\\n├── ruoyi-template 模板模块\\n├── ry.bat\\n├── ry.sh\\n└── sql 数据库脚本</code></pre>\\n<h2>安装$运行</h2>\\n<p>&nbsp;</p>\\n<pre class=\\\"language-java\\\"><code>ruoyi:\\n  # 名称\\n  name: zgcms\\n  # 版本\\n  version: 4.7.3\\n  # 版权年份\\n  copyrightYear: 2021\\n  # 实例演示开关\\n  demoEnabled: true\\n  # 是否指定任意目录\\n  appointProfile: false\\n  # 储存相关根目录\\n  profile: .zgcms\\n  # 获取ip地址开关\\n  addressEnabled: false</code></pre>\\n<ul>\\n<li>项目默认工作目录在用户目录/.ruoyi目录下,同级目录config用于存放覆盖默认配置的一些文件。</li','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-05 22:18:45'),(1687,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"6\"],\"articleTitle\":[\"止戈内容介绍\"],\"articleUrl\":[\"165358895425\"],\"keywords\":[\"\"],\"cats\":[\"2,9\"],\"tags\":[\"1\"],\"chooseTag\":[\"\"],\"articleType\":[\"1\"],\"allowComment\":[\"1\"],\"description\":[\"豆腐干豆腐干地方\"],\"reprintUrl\":[\"\"],\"articleImg\":[\"\"],\"articleMd\":[\"## 止戈简介\\n目前同步至若依4.7.4,内容部分已经基本完成。\\n* 模板：支持普通页面,数据页面以及一些案例模板,其中页面主要以HTML片段，案例模板可以是图片，文档等等。HTML片段方便系统维护及管理，案例模板则可以规范站点内容的维护或者各种单子发票的统一。\\n* 主题：支持主题上传,切换以及个性化设置,备份主题,支持多主题。通过简单配置,即可实现实现群站效果。\\n* 栏目：前端菜单管理,支持多级树,可以应付复杂的导航,已支持额外SEO字段。\\n* 分类：支持多级树,完全可以应付复杂分类,已支持额外SEO字段。\\n* 标签：标签用于标记文章特色,已支持额外SEO字段。\\n* 文章：支持不同类型,特色推荐,多关键字的文章发布,支持额外SEO字段。\\n* 储存：储存方面统一接口,文件可视化管理,方便后续的维护以及扩展。\\n* 邮件：邮件支持在线配置,发送,支持多种类型邮件发送,支持定时发送。\\n* 链接：支持分组,方便做导航类网站。\\n* 文章：包含评论,浏览记录,评分,收藏等。\\n* 反馈: 支持不同类型反馈,方便搜集用户在使用中存在的问题。\\n* 标签：使用Thymeleaf模板,可直接调用service,简化主题开发\\n***\\n\\n## 目录说明\\n```\\nRuoYi\\n ├── bin\\n ├── doc\\n ├── LICENSE\\n ├── pom.xml\\n ├── README.md\\n ├── ruoyi-admin      管理模块\\n ├── ruoyi-common     通用工具类\\n ├── ruoyi-framework  项目核心\\n ├── ruoyi-generator  代码生成\\n ├── ruoyi-mail       邮件模块\\n ├── ruoyi-mybatis    数据连接\\n ├── ruoyi-oly\\n │   ├── oly-cms      内容聚合模块\\n │   │   ├── cms-admin   管内容理\\n │   │   ├── cms-comment  评论\\n │   │   ├── cms-common    通用工具\\n │   │   ├── cms-general   通用服务\\n │   │   ├── cms-hander    控制模块\\n │   │   ├── cms-web       前端模块\\n ├── ruoyi-oss        储存模块\\n ├── ruoyi-quartz     定时任务\\n ├── ruoyi-system\\n │   ├── system-config 配置模块\\n │   ├── system-core   系统模块\\n │   └── system-dict   字典模块\\n ├── ruoyi-template   模板模块\\n ├── ry.bat\\n ├── ry.sh\\n └── sql   数据库脚本\\n```\\n\\n## 安装$运行\\n- 项目默认工作目录在用户目录/.ruoyi目录下,同级目录config用于存放覆盖默认配置的一些文件。\\n- 系统已经集成flyway,因此只需要建数据库即可，如果是在Linux下运行本程序,由于Mysql默认大小写敏感,运行时会导致quartz找不到表，导致本程序无法启动。所以在安装数据库时配置lower_case_table_names=1,避免再次折腾,寻找解决方案。\\n### 配置\\n  1. 默认方式\\n 本程序所有操作,在用户工作目录的/.zgcms下。包括日志记录,主题文件,本地文件储存,备份文件等等...默认配置如下：\\n\\n```\\nruoyi:\\n  # 名称\\n  name: zgcms\\n  # 版本\\n  version: 4.7.3\\n  # 版权年份\\n  copyrightYear: 2021\\n  # 实例演示开关\\n  demoEnabled: true\\n  # 是否指定任意目录\\n  appointProfile: false\\n  # 储存相关根目录\\n  profile: .zgcms\\','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-05 22:22:18'),(1688,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"6\"],\"articleTitle\":[\"止戈内容介绍\"],\"articleUrl\":[\"165358895425\"],\"keywords\":[\"\"],\"cats\":[\"2,9\"],\"tags\":[\"1\"],\"chooseTag\":[\"\"],\"articleType\":[\"1\"],\"allowComment\":[\"1\"],\"description\":[\"豆腐干豆腐干地方\"],\"reprintUrl\":[\"\"],\"articleImg\":[\"\"],\"articleMd\":[\"[TOC]\\n## 止戈简介\\n目前同步至若依4.7.4,内容部分已经基本完成。\\n* 模板：支持普通页面,数据页面以及一些案例模板,其中页面主要以HTML片段，案例模板可以是图片，文档等等。HTML片段方便系统维护及管理，案例模板则可以规范站点内容的维护或者各种单子发票的统一。\\n* 主题：支持主题上传,切换以及个性化设置,备份主题,支持多主题。通过简单配置,即可实现实现群站效果。\\n* 栏目：前端菜单管理,支持多级树,可以应付复杂的导航,已支持额外SEO字段。\\n* 分类：支持多级树,完全可以应付复杂分类,已支持额外SEO字段。\\n* 标签：标签用于标记文章特色,已支持额外SEO字段。\\n* 文章：支持不同类型,特色推荐,多关键字的文章发布,支持额外SEO字段。\\n* 储存：储存方面统一接口,文件可视化管理,方便后续的维护以及扩展。\\n* 邮件：邮件支持在线配置,发送,支持多种类型邮件发送,支持定时发送。\\n* 链接：支持分组,方便做导航类网站。\\n* 文章：包含评论,浏览记录,评分,收藏等。\\n* 反馈: 支持不同类型反馈,方便搜集用户在使用中存在的问题。\\n* 标签：使用Thymeleaf模板,可直接调用service,简化主题开发\\n***\\n\\n## 目录说明\\n```\\nRuoYi\\n ├── bin\\n ├── doc\\n ├── LICENSE\\n ├── pom.xml\\n ├── README.md\\n ├── ruoyi-admin      管理模块\\n ├── ruoyi-common     通用工具类\\n ├── ruoyi-framework  项目核心\\n ├── ruoyi-generator  代码生成\\n ├── ruoyi-mail       邮件模块\\n ├── ruoyi-mybatis    数据连接\\n ├── ruoyi-oly\\n │   ├── oly-cms      内容聚合模块\\n │   │   ├── cms-admin   管内容理\\n │   │   ├── cms-comment  评论\\n │   │   ├── cms-common    通用工具\\n │   │   ├── cms-general   通用服务\\n │   │   ├── cms-hander    控制模块\\n │   │   ├── cms-web       前端模块\\n ├── ruoyi-oss        储存模块\\n ├── ruoyi-quartz     定时任务\\n ├── ruoyi-system\\n │   ├── system-config 配置模块\\n │   ├── system-core   系统模块\\n │   └── system-dict   字典模块\\n ├── ruoyi-template   模板模块\\n ├── ry.bat\\n ├── ry.sh\\n └── sql   数据库脚本\\n```\\n\\n## 安装$运行\\n- 项目默认工作目录在用户目录/.ruoyi目录下,同级目录config用于存放覆盖默认配置的一些文件。\\n- 系统已经集成flyway,因此只需要建数据库即可，如果是在Linux下运行本程序,由于Mysql默认大小写敏感,运行时会导致quartz找不到表，导致本程序无法启动。所以在安装数据库时配置lower_case_table_names=1,避免再次折腾,寻找解决方案。\\n### 配置\\n  1. 默认方式\\n 本程序所有操作,在用户工作目录的/.zgcms下。包括日志记录,主题文件,本地文件储存,备份文件等等...默认配置如下：\\n\\n```\\nruoyi:\\n  # 名称\\n  name: zgcms\\n  # 版本\\n  version: 4.7.3\\n  # 版权年份\\n  copyrightYear: 2021\\n  # 实例演示开关\\n  demoEnabled: true\\n  # 是否指定任意目录\\n  appointProfile: false\\n  # 储存相关根目录\\n  profile: ','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-05 22:38:32'),(1689,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"13\"],\"articleTitle\":[\"开始使用\"],\"articleUrl\":[\"1659670590511\"],\"keywords\":[\"使用说明\"],\"cats\":[\"9\"],\"tags\":[\"1\"],\"chooseTag\":[\"\"],\"articleType\":[\"6\"],\"allowComment\":[\"1\"],\"description\":[\"\"],\"reprintUrl\":[\"\"],\"articleImg\":[\"\"],\"articleContent\":[\"<div class=\\\"markdown-toc\\\">\\n<h2>目录</h2>\\n<ul>\\n<li><a href=\\\"#h2-u6B62u6208u7B80u4ECB\\\">止戈简介</a></li>\\n<li><a href=\\\"#h2-u76EEu5F55u8BF4u660E\\\">目录说明</a></li>\\n<li><a href=\\\"#mcetoc_1g9n73o8k3\\\">安装$运行</a>\\n<ul>\\n<li><a href=\\\"#h3-u914Du7F6E\\\">配置</a></li>\\n</ul>\\n</li>\\n<li><a href=\\\"#h2-u6CE8u610Fu4E8Bu9