'/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"6\"],\"articleTitle\":[\"止戈内容介绍\"],\"articleUrl\":[\"165358895425\"],\"keywords\":[\"\"],\"cats\":[\"2,9\"],\"tags\":[\"1\"],\"chooseTag\":[\"\"],\"articleType\":[\"1\"],\"allowComment\":[\"1\"],\"description\":[\"豆腐干豆腐干地方\"],\"reprintUrl\":[\"\"],\"articleImg\":[\"\"],\"articleMd\":[\"[TOC]\\n## 止戈简介\\n目前同步至若依4.7.4,内容部分已经基本完成。\\n* 模板：支持普通页面,数据页面以及一些案例模板,其中页面主要以HTML片段，案例模板可以是图片，文档等等。HTML片段方便系统维护及管理，案例模板则可以规范站点内容的维护或者各种单子发票的统一。\\n* 主题：支持主题上传,切换以及个性化设置,备份主题,支持多主题。通过简单配置,即可实现实现群站效果。\\n* 栏目：前端菜单管理,支持多级树,可以应付复杂的导航,已支持额外SEO字段。\\n* 分类：支持多级树,完全可以应付复杂分类,已支持额外SEO字段。\\n* 标签：标签用于标记文章特色,已支持额外SEO字段。\\n* 文章：支持不同类型,特色推荐,多关键字的文章发布,支持额外SEO字段。\\n* 储存：储存方面统一接口,文件可视化管理,方便后续的维护以及扩展。\\n* 邮件：邮件支持在线配置,发送,支持多种类型邮件发送,支持定时发送。\\n* 链接：支持分组,方便做导航类网站。\\n* 文章：包含评论,浏览记录,评分,收藏等。\\n* 反馈: 支持不同类型反馈,方便搜集用户在使用中存在的问题。\\n* 标签：使用Thymeleaf模板,可直接调用service,简化主题开发\\n***\\n\\n```\\n\\n<!DOCTYPE html>\\n<html lang=\\\"zh\\\" xmlns:th=\\\"http://www.thymeleaf.org\\\"\\n    th:with=\\\"blogConfig=${@configTag.getConfigMapValue(\'zgblog\')},post=${@articleTag.getWebArticleHtmlById(postId==null?@configTag.getKey(\'zgblog\',\'oly.web.theme.zgblog.docs.defaultPostId\'):postId)}\\\">\\n\\n<head th:if=\\\"${post!=null}\\\">\\n    <th:block th:include=\\\"zgblog/blog_include :: blogHeader(title=${blogConfig[\'oly.web.title\']+\'-\'+post.articleTitle},\\nkeywords=${blogConfig[\'oly.web.keywords\']+\',\'+post.keywords},\\ndescription=${post.description},\\nblogConfig=${blogConfig})\\\" />\\n    <th:block th:include=\\\"zgblog/blog_include :: reset_css\\\" />\\n    <link th:href=\\\"@{/themes/zgblog/resources/css/global.css?a=uhg}\\\" rel=\\\"stylesheet\\\">\\n    <link rel=\\\"stylesheet\\\" href=\\\"https://cdn.jsdelivr.net/npm/prismjs@1.28.0/themes/prism-okaidia.min.css\\\">\\n</head>\\n\\n<head th:if=\\\"${post==null}\\\">\\n    <th:block th:include=\\\"zgblog/blog_include :: blogHeader(title=${blogConfig[\'oly.web.title\']},\\nkeywords=${blogConfig[\'oly.web.keywords\']},\\ndescription=\'文章不存在\',\\nblogConfig=${blogConfig})\\\" />\\n    <link th:href=\\\"@{/themes/zgblog/resources/css/global.css}\\\" rel=\\\"stylesheet\\\" />\\n</head>\\n<style>\\n/* PrismJS 1.28.0\\nh','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-06 02:52:12'),(1715,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"13\"],\"articleTitle\":[\"开始使用\"],\"articleUrl\":[\"1659670590511\"],\"keywords\":[\"使用说明\"],\"cats\":[\"9\"],\"tags\":[\"1\"],\"chooseTag\":[\"\"],\"articleType\":[\"6\"],\"allowComment\":[\"1\"],\"description\":[\"\"],\"reprintUrl\":[\"\"],\"articleImg\":[\"\"],\"articleContent\":[\"<pre class=\\\"language-markup\\\"><code># 项目相关配置\\nruoyi:\\n  # 名称\\n  name: ZhiGe\\n  # 版本\\n  version: 4.7.3\\n  # 版权年份\\n  copyrightYear: 2021\\n  # 是否指定任意目录\\n  appointProfile: false\\n  # 储存相关根目录\\n  profile: .ruoyi\\n  # 获取ip地址开关\\n  addressEnabled: false\\n# 开发环境配置\\nserver:\\n  # 服务器的HTTP端口，默认为80\\n  port: 8090\\n  servlet:\\n    # 应用的访问路径\\n    context-path: /\\n    encoding:\\n      enabled: true\\n      charset: UTF-8\\n      force: true\\n  tomcat:\\n    # tomcat的URI编码\\n    uri-encoding: UTF-8\\n    # 连接数满后的排队数，默认为100\\n    accept-count: 1000\\n    threads:\\n      # tomcat最大线程数，默认为200\\n      max: 800\\n      # Tomcat启动初始化的线程数，默认值10\\n      min-spare: 100\\n \\n# 日志配置\\nlogging:\\n  level:\\n    com.ruoyi: debug\\n    org.springframework: warn\\n    com.oly: debug \\n# 用户配置\\nuser:\\n  password:\\n    # 密码错误{maxRetryCount}次锁定10分钟\\n    maxRetryCount: 5\\n\\n# Spring配置\\nspring:\\n  # 模板引擎\\n  thymeleaf:\\n    mode: HTML\\n    encoding: utf-8\\n    # 禁用缓存\\n    cache: false\\n    prefix: classpath:/templates/\\n    template-resolver-order: 1\\n  # 资源信息\\n  messages:\\n    # 国际化资源文件路径\\n    basename: static/i18n/messages\\n  jackson:\\n    time-zone: GMT+8\\n    date-format: yyyy-MM-dd HH:mm:ss\\n  profiles: \\n    active: prod\\n    group: \\