he:\\n    type: ehcache\\n    ehcache:\\n      config: cl','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-06 05:41:29'),(1720,'文章管理',1,'com.oly.cms.admin.controller.page.CmsArticleController.add()','POST',1,'admin','研发部门','/cms/article/add','127.0.0.1','内网IP','{\"articleTitle\":[\"止戈建站系统简介\"],\"articleUrl\":[\"1659766437131\"],\"keywords\":[\"止戈文档,止戈建站系统\"],\"editor\":[\"\"],\"cats\":[\"9\"],\"tags\":[\"1\"],\"chooseTag\":[\"1\"],\"articleType\":[\"0\"],\"description\":[\"\"],\"allowComment\":[\"1\"],\"reprintUrl\":[\"\"],\"articleImg\":[\"\"],\"articleContent\":[\"<h2 id=\\\"h2-u6B62u6208u7B80u4ECB\\\">前言</h2>\\n<p>止戈建站系统是一款基于JAVA开发的建站系统，上手简单，支持不同站点的建设。包括个人博客，公司官网，论坛，优惠卷推广等等。&nbsp;目前同步至若依4.7.4，内容部分已完成，示例主题基本完成，基本能满足日常使用。</p>\\n<ul>\\n<li>模板：支持普通页面,数据页面以及一些案例模板,其中页面主要以HTML片段，模板可以是图片，文档等。</li>\\n<li>主题：支持主题上传，主题设置，主题编辑，备份主题等。同时支持多主题同时运行，通过简单设置即可实现群站效果。</li>\\n<li>栏目：前端菜单管理，支持多级树，可以应付复杂的导航，已支持额外SEO字段。</li>\\n<li>分类：支持多级树，全可以应付复杂分类，已支持额外SEO字段。</li>\\n<li>标签：标签用于标记特殊文章，已支持额外SEO字段。</li>\\n<li>文章：支持多种编辑器，支持评论操作，支持额外SEO字段。</li>\\n<li>评论：支持评论以及评论相关操作。</li>\\n<li>储存：储存方面统一接口，文件可视化管理，方便后续的维护以及扩展。</li>\\n<li>邮件：邮件支持在线配置，发送，支持多种类型邮件发送，同时支持定时发送。</li>\\n<li>链接：支持分组，方便做导航类网站。</li>\\n<li>反馈: 支持不同类型反馈，方便搜集用户在使用中存在的问题。</li>\\n<li>标签：使用Thymeleaf模板，可直接调用service，简化主题开发。</li>\\n<li>API：提供简单API，方便单页主题的制作。</li>\\n<li>联盟：支持淘宝，京东，拼多多商品推广。</li>\\n</ul>\\n<h2>如何下载</h2>\\n<p>项目目前托管在码云，有喜欢的小伙伴可以前去看看，下载下来使用一下。</p>\\n<ul>\\n<li style=\\\"list-style-type: initial;\\\"><a href=\\\"https://gitee.com/Getawy/zhige\\\">后台地址</a></li>\\n<li style=\\\"list-style-type: initial;\\\"><a href=\\\"https://gitee.com/Getawy/zgblog\\\">主题地址</a></li>\\n<li style=\\\"list-style-type: initial;\\\"><a href=\\\"https://gitee.com/Getawy/zhige/blob/master/pingpinduo.site\\\">主题预览地址</a></li>\\n<li style=\\\"list-style-type: initial;\\\"><a href=\\\"https://gitee.com/Getawy/zhige/blob/master/pingpinduo.site/admin\\\">后台预览地址</a></li>\\n</ul>\\n<h2>目录说明</h2>\\n<p>部分模块有分拆，有按照项目需求有修，目录结构大致如下：</p>\\n<pre class=\\\"language-java\\\"><code>RuoYi\\n ├── bin\\n ├── doc\\n ├── LICENSE\\n ├── pom.xml\\n ├── README.md\\n ├── ruoyi-admin      管理模块\\n ├── ruoyi-common     通用工具类\\n ├── ruoyi-framework  项目核心\\n ├── ruoyi-generator  代码生成\\n ├── ruoyi-mail       邮件模块\\n ├── ruoyi-mybatis    数据连接\\n ├── ruoyi-oly\\n │   ├── oly-cms      内容聚合模块\\n │   │   ├── cms-admin   管内容理\\n │   │   ├── cms-comment  评论\\n │   │   ├── cms-commo','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-06 14:14:58'),(1721,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editVisible()','POST',1,'admin','研发部门','/cms/article/editVisible','127.0.0.1','内网IP','{\"visible\":[\"3\"],\"articleIds\":[\"15\"]}','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-06 14:15:04'),(1722,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editArticleTop()','POST',1,'admin','研发部门','/cms/article/editArticleTop','127.0.0.1','内网IP','{\"articleTop\":[\"0\"],\"articleIds\":[\"15\"]}','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-06 16:19:17'),(1723,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"15\"],\"articleTitle\":[\"止戈建站系统简介\"],\"articleUrl\":[\"1659766437131\"],\"keywords\":[\"止戈文档,止戈建站系统\"],\"editor\":[\"<h2 id=\\\"h2-u6B62u6208u7B80u4ECB\\\">前言</h2><p>止戈建站系统是一款基于JAVA开发的建站系统，上手简单，支持不同站点的建设。包括个人博客，公司官网，论坛，优惠卷推广等等。&nbsp;目前同步至若依4.7.4，内容部分已完成，示例主题基本完成，基本能满足日常使用。</p><ul><li>模板：支持普通页面,数据页面以及一些案例模板,其中页面主要以HTML片段，模板可以是图片，文档等。</li><li>主题：支持主题上传，主题设置，主题编辑，备份主题等。同时支持多主题同时运行，通过简单设置即可实现群站效果。</li><li>栏目：前端菜单管理，支持多级树，可以应付复杂的导航，已支持额外SEO字段。</li><li>分类：支持多级树，全可以应付复杂分类，已支持额外SEO字段。</li><li>标签：标签用于标记特殊文章，已支持额外SEO字段。</li><li>文章：支持多种编辑器，支持评论操作，支持额外SEO字段。</li><li>评论：支持评论以及评论相关操作。</li><li>储存：储存方面统一接口，文件可视化管理，方便后续的维护以及扩展。</li><li>邮件：邮件支持在线配置，发送，支持多种类型邮件发送，同时支持定时发送。</li><li>链接：支持分组，方便做导航类网站。</li><li>反馈: 支持不同类型反馈，方便搜集用户在使用中存在的问题。</li><li>标签：使用Thymeleaf模板，可直接调用service，简化主题开发。</li><li>API：提供简单API，方便单页主题的制作。</li><li>联盟：支持淘宝，京东，拼多多商品推广。<