", \\\"Mango\\\"];\\ndocument.getElementById(\\\"demo\\\").innerHTML = fruits.toString(); \\n</pre>\\n<p>结果</p>\\n<pre>Banana,Orange,Apple,Mango</pre>\\n<p><a href=\\\"https://www.w3school.com.cn/tiy/t.asp?f=eg_js_array_tostring\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">亲自试一试</a></p>\\n<p><code>join()</code>&nbsp;方法也可将所有数组元素结合为一个字符串。</p>\\n<p>它的行为类似 toString()，但是您还可以规定分隔符：</p>\\n<h3 id=\\\"mcetoc_1g9087782k\\\">实例</h3>\\n<pre>var fruits = [\\\"Banana\\\", \\\"Orange\\\",\\\"Apple\\\", \\\"Mango\\\"];\\ndocument.getElementById(\\\"demo\\\").innerHTML = fruits.join(\\\" * \\\"); \\n</pre>\\n<p>结果</p>\\n<pre>Banana * Orange * Apple * Mango</pre>\\n<p><a href=\\\"https://www.w3school.com.cn/tiy/t.asp?f=eg_js_array_join\\\" target=','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-07 21:06:41'),(1777,'主题管理',2,'com.oly.cms.admin.controller.page.CmsThemeController.buildArticleIndex()','POST',1,'admin','研发部门','/cms/theme/buildArticleIndex/zgblog','127.0.0.1','内网IP','\"zgblog\"','{\"msg\":\"操作成功\",\"code\":0,\"data\":28}',0,NULL,'2022-08-07 21:07:25'),(1778,'主题管理',2,'com.oly.cms.admin.controller.page.CmsThemeController.buildArticleIndex()','POST',1,'admin','研发部门','/cms/theme/buildArticleIndex/zgblog','127.0.0.1','内网IP','\"zgblog\"','{\"msg\":\"操作成功\",\"code\":0,\"data\":28}',0,NULL,'2022-08-07 21:07:28'),(1779,'主题管理',2,'com.oly.cms.admin.controller.page.CmsThemeController.buildArticleIndex()','POST',1,'admin','研发部门','/cms/theme/buildArticleIndex/zgblog','127.0.0.1','内网IP','\"zgblog\"','{\"msg\":\"操作成功\",\"code\":0,\"data\":28}',0,NULL,'2022-08-07 21:07:31'),(1780,'主题管理',2,'com.oly.cms.admin.controller.page.CmsThemeController.editByGkSaves()','POST',1,'admin','研发部门','/cms/theme/updateByGk','127.0.0.1','内网IP','{\"oly.web.article.supportType\":[\"0,1,3,4,6\"],\"oly.web.comment.enable\":[\"true\"],\"configGroup\":[\"zgblog\"]}','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-07 21:07:37'),(1781,'主题管理',2,'com.oly.cms.admin.controller.page.CmsThemeController.editByGkSaves()','