研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"15\"],\"articleTitle\":[\"系统简介\"],\"articleUrl\":[\"1659766437131\"],\"keywords\":[\"止戈文档,止戈建站系统\"],\"editor\":[\"\"],\"cats\":[\"9\"],\"tags\":[\"1\"],\"chooseTag\":[\"\"],\"articleType\":[\"6\"],\"allowComment\":[\"1\"],\"description\":[\"\"],\"reprintUrl\":[\"\"],\"articleImg\":[\"\"],\"articleContent\":[\"<div class=\\\"markdown-toc\\\">\\n<h2>目录</h2>\\n<ul>\\n<li><a href=\\\"#h2-u6B62u6208u7B80u4ECB\\\">系统简介</a>\\n<ul>\\n<li><a href=\\\"#mcetoc_1g9sf5dji3a\\\">若依简介</a></li>\\n<li><a href=\\\"#主要特性\\\">止戈简介</a></li>\\n</ul>\\n</li>\\n<li><a href=\\\"#mcetoc_1g9seq6p03\\\">系统需求</a></li>\\n<li><a href=\\\"#mcetoc_1g9rh8evmc\\\">项目地址</a></li>\\n<li><a href=\\\"#mcetoc_1g9rh8evmc\\\">注意事项</a></li>\\n</ul>\\n</div>\\n<h2 id=\\\"h2-u6B62u6208u7B80u4ECB\\\">系统简介</h2>\\n<h3 id=\\\"mcetoc_1g9sf5dji3a\\\">若依简介</h3>\\n<p>RuoYi 是一个 Java EE 企业级快速开发平台，基于经典技术组合（Spring Boot、Apache Shiro、MyBatis、Thymeleaf、Bootstrap），内置模块如：部门管理、角色用户、菜单及按钮授权、数据权限、系统参数、日志管理、通知公告等。在线定时任务配置；支持集群，支持多数据源，支持分布式事务。</p>\\n<ul>\\n<li>RuoYi 官网地址：<a href=\\\"http://ruoyi.vip/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">http://ruoyi.vip</a></li>\\n<li>RuoYi 在线文档：<a href=\\\"http://doc.ruoyi.vip/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">http://doc.ruoyi.vip</a></li>\\n<li>RuoYi 源码下载：<a href=\\\"https://gitee.com/y_project/RuoYi\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">https://gitee.com/y_project/RuoYi</a></li>\\n<li>RuoYi 在线提问：<a href=\\\"https://gitee.com/y_project/RuoYi/issues\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">https://gitee.com/y_project/RuoYi/issues</a></li>\\n<li>RuoYi 博客：<a href=\\\"https://www.oschina.net/p/ruoyi\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">https://www.oschina.net/p/ruoyi</a></li>\\n</ul>\\n<h4 id=\\\"主要特性\\\">主要特性</h4>\\n<ul>\\n<li>完全响应式布局（支持电脑、平板、手机等所有主流设备）</li>\\n<li>强大的一键生成功能（包括控制器、模型、视图、菜单等）</li>\\n<li>支持多数据源，简单配置即可实现切换。</li>\\n<li>支持按钮及数据权限，可自定义部门数据权限。</li>\\n<li>对常用js插件进行二次封装，使js代码变得简洁，更加易维护</li>\\n<li>完善的XSS防范及脚本过滤，彻底杜绝XSS攻击</li>\\n<li>Maven多项目依赖，模块及插件分项目，尽量松耦合，方便模块升级、增减模块。</li>\\n<li>国际化支持，服务端及客户端支持</li>\\n<li>完善的日志记录体系简单注解即可实现</li>\\n<li>支持服务监控，数据监控，缓存监控功能。</li>\\n</ul>\\n<h4','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-08 02:50:38'),(1808,'主题管理',2,'com.oly.cms.admin.controller.page.CmsThemeController.buildArticleIndex()','POST',1,'admin','研发部门','/cms/theme/buildArticleIndex/zgblog','127.0.0.1','内网IP','\"zgblog\"','{\"msg\":\"操作成功\",\"code\":0,\"data\":4}',0,NULL,'2022-08-08 02:52:09'),(1809,'主题管理',2,'com.oly.cms.admin.controller.page.CmsThemeController.buildArticleIndex()','POST',1,'admin','研发部门','/cms/theme/buildArticleIndex/zgblog','127.0.0.1','内网IP','\"zgblog\"','{\"msg\":\"操作成功\",\"code\":0,\"data\":4}',0,NULL,'2022-08-08 02:52:11'),(1810,'主题管理',2,'com.oly.cms.admin.controller.page.CmsThemeController.editByGkSaves()','POST',1,'admin','研发部门','/cms/theme/updateByGk','127.0.0.1','内网IP','{\"oly.web.article.supportType\":[\"\"],\"oly.web.comment.enable\":[\"true\"],\"configGroup\":[\"zgblog\"]}','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-08 02:52:13'),(1811,'字典数据',2,'com.ruoyi.web.controller.system.SysDictDataController.editSave()','POST',1,'admin','研发部门','/system/dict/data/edit','127.0.0.1','内网IP','{\"dictCode\":[\"208\"],\"dictLabel\":[\"省钱\"],\"dictValue\":[\"6\"],\"dictType\":[\"cms_article_type\"],\"cssClass\":[\"\"],\"dictSort\":[\"6\"],\"listClass\":[\"warning\"],\"isDefault\":[\"Y\"],\"status\":[\"0\"],\"remark\":[\"省钱教程\"]}','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-08 21:39:54'),(1812,'主题管理',2,'com.oly.cms.admin.controller.page.CmsThemeController.editByGkSaves()','POST',1,'admin','研发部门','/cms/theme/updateByGk','127.0.0.1','内网IP','{\"oly.web.pageIndex\":[\"2\"],\"oly.web.pageCategory\":[\"19\"],\"oly.web.pageTag\":[\"18\"],\"oly.web.pageRank\":[\"22\"],\"oly.web.pageLinks\":[\"\"],\"oly.web.pageTimeLine\":[\"\"],\"oly.web.pageAbout\":[\"7\"],\"oly.web.pageUnion\":[\"\"],\"oly.web