se near \'update cms_cat as t1 set cat_count=(select count(*) from cms_article_cat as t2 w\' at line 4','2022-08-10 21:14:30'),(1913,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.addTagArticle()','POST',1,'admin','研发部门','/cms/article/addTagArticle','127.0.0.1','内网IP','{\"articleId\":[\"5\"],\"tagId\":[\"3\"]}','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-10 21:14:37'),(1914,'文章管理',2,'com.oly.cms.admin.controller.page.CmsArticleController.editSave()','POST',1,'admin','研发部门','/cms/article/edit','127.0.0.1','内网IP','{\"articleId\":[\"5\"],\"articleTitle\":[\"test22\"],\"articleUrl\":[\"1653588954255\"],\"keywords\":[\"fdvfdgfd\"],\"cats\":[\"1\"],\"tags\":[\"1,3\"],\"chooseTag\":[\"\"],\"articleType\":[\"5\"],\"allowComment\":[\"1\"],\"description\":[\"\"],\"reprintUrl\":[\"\"],\"articleImg\":[\"http://127.0.0.1:8090/oss/download/image/2022/07/21/nav-icon-cat_20220721143527A002.png\"],\"articleMd\":[\"![](http://127.0.0.1:8090/oss/download/image/2022/07/21/nav-icon-cat_20220721143527A002.png)# 基本介绍\\n- 止戈建站系统是一款用于开发网站的软件，基本能满足一般的个人网站，个人博客，公司网站，资讯网站，论坛等网站的开发与维护。\\n- 其制作过程只需要关注前端部分的展示，稍加学习，即可制作出满足大多数需求的网站。如若有特殊需求，也可以自主进行开发。\\n- 支持多套主题同时运行，也可以多套主题共享数据，也可以后台进行简单的数据配置，主题之间数据隔离，可达到群站的效果。\\n- 内置权限系统，基本能满足大多数应用场景，通过简单的权限配置，以应对不同人员对网站数据的编辑需求。\\n- 基于若依，基础模块完善，内容模块完善，方便便后续二次开发。\\n- 基于Java开发，主要使用的框架是Spring Boot、安全框架Apache Shiro、使用模板Thymeleaf+hplus、使用缓存Ehcache、数据库使用的是MySQL，MyBatis用于数据操作、同时系统支持Flyway，主要用于数据初始化以及迁移。\\n# 项目目录\\n# 项目安装\\n# 项目预览\\n# 项目地址\\n- [后台地址](https://gitee.com/Getawy/zhige)\\n- [主题地址](https://gitee.com/Getawy/zgblog)\\n- [主题预览地址](pingpinduo.site)\\n- [后台预览地址](pingpinduo.site/admin)\"],\"articleContent\":[\"<p><img src=\\\"http://127.0.0.1:8090/oss/download/image/2022/07/21/nav-icon-cat_20220721143527A002.png\\\" alt=\\\"\\\"># 基本介绍\\n</p><ul>\\n<li>止戈建站系统是一款用于开发网站的软件，基本能满足一般的个人网站，个人博客，公司网站，资讯网站，论坛等网站的开发与维护。</li><li>其制作过程只需要关注前端部分的展示，稍加学习，即可制作出满足大多数需求的网站。如若有特殊需求，也可以自主进行开发。</li><li>支持多套主题同时运行，也可以多套主题共享数据，也可以后台进行简单的数据配置，主题之间数据隔离，可达到群站的效果。</li><li>内置权限系统，基本能满足大多数应用场景，通过简单的权限配置，以应对不同人员对网站数据的编辑需求。</li><li>基于若依，基础模块完善，内容模块完善，方便便后续二次开发。</li><li>基于Java开发，主要使用的框架是Spring Boot、安全框架Apache Shiro、使用模板Thymeleaf+hplus、使用缓存Ehcache、数据库使用的是MySQL，MyBatis用于数据操作、同时系统支持Flyway，主要用于数据初始化以及迁移。<h1 id=\\\"h1-u9879u76EEu76EEu5F55\\\"><a name=\\\"项目目录\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>项目目录</h1><h1 id=\\\"h1-u9879u76EEu5B89u88C5\\\"><a name=\\\"项目安装\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>项目安装</h1><h1 id=\\\"h1-u9879u76EEu9884u89C8\\\"><a name=\\\"项目预览\\\" class=\\\"reference-link\\\"></a><span class=\\\"head','{\"msg\":\"操作成功\",\"code\":0}',0,NULL,'2022-08-10 21:14:41'),(1915,'文章管理',3,'com.oly.cms.admin.controller.page.CmsArticleController.remove()','POST',1,'admin','研发部门','/cms/article/remove','127.0.0.1','内网IP','{\"ids\":[\"5\"]}',NULL,1,'\r\n### Error updating database.  Cause: java.sql.SQLSyntaxErrorException: You have an error in your SQL syntax; check the manual that corresponds to your MySQL server version for the right syntax to use near \'update cms_tag as t1 set tag_count=(select count(*) from cms_article_tag as t2 w\' at line 4\r\n### The error may exist in file [H:\\RuoYi\\ruoyi-oly\\oly-cms\\cms-admin\\target\\classes\\mapper\\oly\\CmsArticleLiquidMapper.xml]\r\n### The error may involve defaultParameterMap\r\n### The error occurred while setting parameters\r\n### SQL: update cms_tag as t1 set tag_count=(select count(*) from cms_article_tag as t2 where t2.tag_id=?)             where t1.tag_id=?          ;              update cms_tag as t1 set tag_count=(select count(*) from cms_article_tag as t2 where t2.tag_id=?)             where t1.tag_id=?\r\n### Cause: java.sql.SQLSyntaxErrorException: You have an error in your SQL syntax; check the manual that corresponds to your MySQL server version for the right syntax to use near \'update cms_tag as t1 set tag_count=(select count(*) from cms_article_tag as t2 w\